import {useState} from "react";

const jsonData = [
  {
  key: "1",
  name: "Juan"
}, {
  key: "2",
  name: "Valeria"
}, {
  key: "3",
  name: "Max"
}, {
  key: "4",
  name: "Alfonso"
}
];

const App = () => {
  const renderData = () => {
    return jsonData?.map((value, index) => (
      <div key={value.key}>
        <p>{value.name}</p>
      </div>
    ))
  }
  return (
    <div>
      Hola {renderData()}
    </div>
  );
}

export default App;
